                div.innerHTML = `
            <div id="vl-combine-title">Kombin rnler</div>
            <div id="vl-combine-close">-</div>
            <div id="vl-combine-exit">X</div>
            <a target="_blank" href="${dataArr[0].dest_url}">
            <img id="vl-combine-img" src="${dataArr[0].img}">
            </a>
            <div id="vl-combine-name">${dataArr[0].title}</div>
            <div id="vl-combine-price">${dataArr[0].price} TL</div>
            <div id="vl-combine-dprice">${dataArr[0].dprice} TL</div>
            <div id="vl-combine-basket"><a target="_blank" style="color:white;" href="${dataArr[0].dest_url}">NCELE</a></div>
 
        `;
                
                document.body.append(div);
                if(dataArr[0].price == dataArr[0].dprice){
                    document.querySelector("#vl-combine-price").style.display="none";
                }
                var divMin = document.createElement("div");
                divMin.setAttribute("id", "vl-combine-min");
                divMin.innerHTML = `
                Kombin rnler
            `;
                document.body.append(divMin);
                divMin.addEventListener("click", Maximize);
                document.querySelector("#vl-combine-close").addEventListener("click", Minimize);
                document.querySelector("#vl-combine-exit").addEventListener("click",function(){
                    div.remove();
                    divMin.remove();
                    document.cookie = `${campName}=true;path=/;`;
                });
